func TestAggregatePair(t *testing.T) {
	sig0, _ := hex.DecodeString("")
	sig1, _ := hex.DecodeString("")

	tests := []struct {
		a1   *zondpb.Attestation
		a2   *zondpb.Attestation
		want *zondpb.Attestation
	}{
		{
			a1: &zondpb.Attestation{
				ParticipationBits: []byte{},
			},
			a2: &zondpb.Attestation{
				ParticipationBits: []byte{},
			},
			want: &zondpb.Attestation{
				ParticipationBits: []byte{},
			},
		},
		{
			a1: &zondpb.Attestation{
				ParticipationBits: bitfield.Bitlist{0x03},
				Signatures:        [][]byte{sig0, sig1},
			},
			a2: &zondpb.Attestation{
				ParticipationBits: bitfield.Bitlist{0x02},
				Signatures:        [][]byte{sig1},
			},
			want: &zondpb.Attestation{
				ParticipationBits: []byte{0x03},
				Signatures:        [][]byte{sig0, sig1},
			},
		},
		{
			a1: &zondpb.Attestation{
				ParticipationBits: bitfield.Bitlist{0x02},
				Signatures:        [][]byte{sig1},
			},
			a2: &zondpb.Attestation{
				ParticipationBits: bitfield.Bitlist{0x03},
				Signatures:        [][]byte{sig0, sig1},
			},
			want: &zondpb.Attestation{
				ParticipationBits: []byte{0x03},
				Signatures:        [][]byte{sig0, sig1},
			},
		},
	}
	for _, tt := range tests {
		got, err := AggregatePair(tt.a1, tt.a2)
		require.NoError(t, err)
		require.Equal(t, true, equality.DeepEqual(got, tt.want))
	}
}

func TestAggregatePair_OverlapFails(t *testing.T) {
	tests := []struct {
		a1 *zondpb.Attestation
		a2 *zondpb.Attestation
	}{
		{
			a1: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0x1F}},
			a2: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0x11}},
		},
		{
			a1: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0xFF, 0x85}},
			a2: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0x13, 0x8F}},
		},
	}
	for _, tt := range tests {
		_, err := AggregatePair(tt.a1, tt.a2)
		require.ErrorContains(t, aggregation.ErrBitsOverlap.Error(), err)
	}
}

func TestAggregateAttestations_AggregatePair_DiffLengthFails(t *testing.T) {
	tests := []struct {
		a1 *zondpb.Attestation
		a2 *zondpb.Attestation
	}{
		{
			a1: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0x0F}},
			a2: &zondpb.Attestation{ParticipationBits: bitfield.Bitlist{0x11}},
		},
	}
	for _, tt := range tests {
		_, err := AggregatePair(tt.a1, tt.a2)
		require.ErrorContains(t, bitfield.ErrBitlistDifferentLength.Error(), err)
	}
}

func TestAggregate(t *testing.T) {
	// Each test defines the aggregation bitfield inputs and the wanted output result.
	// TODO(rgeraldes24) - refactor and review sig numbers
	sig0, _ := hex.DecodeString("")
	sig1, _ := hex.DecodeString("")
	sig2, _ := hex.DecodeString("")
	sig3, _ := hex.DecodeString("")
	sig4, _ := hex.DecodeString("")
	sig5, _ := hex.DecodeString("")
	//sig8, _ := hex.DecodeString("")
	// sig9, _ := hex.DecodeString("")
	// sig10, _ := hex.DecodeString("")

	tests := []struct {
		name   string
		inputs []*zondpb.Attestation
		want   []*zondpb.Attestation
		err    error
	}{
		{
			name: "empty list",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{},
				},
			},
		},
		{
			name: "single attestation",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000010, 0b1},
					Signatures:        [][]byte{sig0},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000010, 0b1},
					Signatures:        [][]byte{sig0},
				},
			},
		},
		{
			name: "two attestations with no overlap",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000001, 0b1},
					Signatures:        [][]byte{sig0},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000010, 0b1},
					Signatures:        [][]byte{sig1},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
			},
		},
		{
			name: "two attestations with no overlap",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000010, 0b1},
					Signatures:        [][]byte{sig1},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000001, 0b1},
					Signatures:        [][]byte{sig0},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
			},
		},
		{
			name: "two attestations with overlap",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000101, 0b1},
					Signatures:        [][]byte{sig0, sig2},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000110, 0b1},
					Signatures:        [][]byte{sig1, sig2},
				},
			},

			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000101, 0b1},
					Signatures:        [][]byte{sig0, sig2},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000110, 0b1},
					Signatures:        [][]byte{sig1, sig2},
				},
			},
		},
		{
			name: "some attestations overlap",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00001001, 0b1},
					Signatures:        [][]byte{sig0, sig3},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00010110, 0b1},
					Signatures:        [][]byte{sig1, sig2, sig4},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00001010, 0b1},
					Signatures:        [][]byte{sig1, sig3},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00110001, 0b1},
					Signatures:        [][]byte{sig0, sig4, sig5},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00111011, 0b1},
					Signatures:        [][]byte{sig0, sig1, sig3, sig4, sig5},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00011111, 0b1},
					Signatures:        [][]byte{sig0, sig1, sig2, sig3, sig4},
				},
			},
		},
		{
			name: "some attestations produce duplicates which are removed",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000101, 0b1},
					Signatures:        [][]byte{sig0, sig2},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000110, 0b1},
					Signatures:        [][]byte{sig1, sig2},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00001010, 0b1},
					Signatures:        [][]byte{sig1, sig3},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00001001, 0b1},
					Signatures:        [][]byte{sig0, sig3},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00001111, 0b1},
					Signatures:        [][]byte{sig0, sig1, sig2, sig3},
				},
			},
		},
		{
			name: "two attestations where one is fully contained within the other",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000001, 0b1},
					Signatures:        [][]byte{sig0},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
			},
		},
		{
			name: "two attestations where one is fully contained within the other reversed",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000001, 0b1},
					Signatures:        [][]byte{sig0},
				},
			},
			want: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b1},
					Signatures:        [][]byte{sig0, sig1},
				},
			},
		},
		{
			name: "attestations with different bitlist lengths",
			inputs: []*zondpb.Attestation{
				{
					ParticipationBits: bitfield.Bitlist{0b00000011, 0b10},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000111, 0b100},
				},
				{
					ParticipationBits: bitfield.Bitlist{0b00000100, 0b1},
				},
			},
			err: bitfield.ErrBitlistDifferentLength,
		},
		/*
			/*
				{
					name:   "256 attestations with single bit set",
					inputs: aggtesting.BitlistsWithSingleBitSet(256, bitlistLen),
					want: []bitfield.Bitlist{
						aggtesting.BitlistWithAllBitsSet(256),
					},
				},
				{
					name:   "1024 attestations with single bit set",
					inputs: aggtesting.BitlistsWithSingleBitSet(1024, bitlistLen),
					want: []bitfield.Bitlist{
						aggtesting.BitlistWithAllBitsSet(1024),
					},
				},
		*/
	}

	for _, tt := range tests {
		runner := func() {
			got, err := Aggregate(tt.inputs)
			if tt.err != nil {
				require.ErrorContains(t, tt.err.Error(), err)
				return
			}
			require.NoError(t, err)
			sort.Slice(got, func(i, j int) bool {
				return got[i].ParticipationBits.Bytes()[0] < got[j].ParticipationBits.Bytes()[0]
			})
			sort.Slice(tt.want, func(i, j int) bool {
				return tt.want[i].ParticipationBits.Bytes()[0] < tt.want[j].ParticipationBits.Bytes()[0]
			})
			assert.Equal(t, len(tt.want), len(got))
			for i, w := range tt.want {
				assert.DeepEqual(t, w.ParticipationBits.Bytes(), got[i].ParticipationBits.Bytes())
				assert.DeepEqual(t, w.Signatures, got[i].Signatures)
			}
		}
		t.Run(tt.name, func(t *testing.T) {
			runner()
		})
	}

	t.Run("broken attestation bitset", func(t *testing.T) {
		wantErr := "bitlist cannot be nil or empty: invalid max_cover problem"
		_, err := Aggregate(aggtesting.MakeAttestationsFromBitlists([]bitfield.Bitlist{
			{0b00000011, 0b0},
			{0b00000111, 0b100},
			{0b00000100, 0b1},
		}))
		assert.ErrorContains(t, wantErr, err)
	})

	/*
		t.Run("candidate swapping when aggregating", func(t *testing.T) {
			// The first item cannot be aggregated, and should be pushed down the list,
			// by two swaps with aggregated items (aggregation is done in-place, so the very same
			// underlying array is used for storing both aggregated and non-aggregated items).
			got, err := Aggregate(aggtesting.MakeAttestationsFromBitlists([]bitfield.Bitlist{
				{0b10000000, 0b1},
				{0b11000101, 0b1},
				{0b00011000, 0b1},
				{0b01010100, 0b1},
				{0b10001010, 0b1},
			}))
			want := []bitfield.Bitlist{
				{0b11011101, 0b1},
				{0b11011110, 0b1},
				{0b10000000, 0b1},
			}
			assert.NoError(t, err)
			assert.Equal(t, len(want), len(got))
			for i, w := range want {
				assert.DeepEqual(t, w.Bytes(), got[i].ParticipationBits.Bytes())
			}
		})
	*/
}

